                    </div>
                </div>
            </div>
            <div class="text">
                <div class="app-icon">
                    <div class="bkg"><img class="union" src="image.svg" /></div>

                    <div class="text-wrapper">WhatsApp</div>

                        <div class="text-wrapper-2">Updated 2024</div>

                        </div>

                        <div class="div-2">
                            <div class="text-wrapper-5">ô€£º</div>

                        </div>

                            <div class="text-wrapper-8">...and more to come!</div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
